// HomeScreen.js
import React from 'react';
import { View, Text, Button } from 'react-native';
import { createDrawerNavigator } from '@react-navigation/drawer';

const Drawer = createDrawerNavigator();

const HomeScreenContent = ({ navigation }) => (
  <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
    <Text>¡Bienvenido! Has entrado.</Text>
    <Button title="Cerrar Sesión" onPress={() => navigation.navigate('Login')} />
  </View>
);

const HomeScreen = ({ navigation }) => (
  <Drawer.Navigator initialRouteName="Home">
    <Drawer.Screen name="Home" component={() => <HomeScreenContent navigation={navigation} />} />
    {/* Agrega más pantallas de menú lateral si es necesario */}
  </Drawer.Navigator>
);

export default HomeScreen;
